import React, { Component } from "react";
import { GreenButton } from "../GreenButton/GreenButton";
import "./ReceivedItemModal.module.scss";

export default class ReceivedItemModal extends Component {
  render() {
    return (
      <div className={styles.receivedItemModal}>
        <h1 className={styles.itemTitle}>{this.props.title}</h1>
        <div className={styles.imageWrap}>
          <img src={this.props.image} alt='' />
        </div>
        <div className={styles.bottomWrap}>
          <span>You got a new item!</span>
          <GreenButton
            onClick={() => {
              this.props.onSubmit();
            }}
            text={"Continue"}
          />
        </div>
      </div>
    );
  }
}
